import { Text, View } from "react-native";
import { Link } from '@react-navigation/web';

const HomeComp = () => {
  return (
    <View>
      <Text>Home Component</Text>
      <Link to="/Details">Go to Details</Link>
      <Link to="/Page3">Go to Page3</Link>
    </View>
  );
}

export default HomeComp;
